import { ReactSVG } from "react-svg";
import london from "./objects/logo.svg";

const places = {
    place: "London",
    country: "UK",
    coverImg:"./objects/London.jpg"
}

export default function Place () {
    return (
        <div className="place">
             <img src={require(`${london}`)}  className="profile-photo" alt="profile"/>
        </div>
    )
}
